(function () {

    $('.burger-collapse-objects').on('hide.bs.collapse', function () {
        $('body').css('overflow', 'visible');
        $('.content-blur-wrapper').removeClass('active');
    });

    // $('.burger-collapse-objects').on('show.bs.collapse', function () {
    //     $('.content-blur-wrapper').addClass('active');
    //     closeOtherAdditionalMenus();
    // });

    $('.burger-collapse-objects').on('shown.bs.collapse', function () {
        if ($(this).hasClass('navigation-container') &&
            isOverflowed($('.navigation-scroll-wrapper')[0])) {
            $('body').css('overflow', 'hidden');
        }
    });

    var header = $('header.main-header');

    $(window).on('scroll', function () {

        if ($(this).scrollTop() > 0) {
            if (!header.hasClass('fixed')) {
                header.addClass('fixed');
                if (header.hasClass('blue')) {
                    header.addClass('active-blue');
                } else {
                    header.addClass('active-white');
                }
            }
        } else {
            header
                .removeClass('fixed')
                .removeClass('active-blue')
                .removeClass('active-white');
        }
    });

    $('#header-about-nav').on('show.bs.collapse', closeOtherAdditionalMenus);
    $('#header-services-nav').on('show.bs.collapse', closeOtherAdditionalMenus);
    $('#header-media-nav').on('show.bs.collapse', closeOtherAdditionalMenus);

    $('.header-menus-extended').click(function (e) {
        e.stopPropagation();
    });

    $('body').click(closeOtherAdditionalMenus);
    $('.other-collapse-trigger').click(closeOtherAdditionalMenus);


    function closeOtherAdditionalMenus() {
        $('.header-menus-extended').find('.collapse.show').collapse('hide');
    }
        $("body").keyup(function(e){
            if(e.keyCode == 27 ){
                closeOtherAdditionalMenus();
                if($(".navigation-container").hasClass("show")){
                    $(".header-collapse-trigger").trigger("click")
                }
            }
        })
})();

function isOverflowed($element) {
    return $element.scrollHeight > $element.clientHeight;
}

