    var timer_mktu,
    prev_item_mktu;
    console.log($(document).width() + " " + $(window).width());
    $(".mktu-block .left-container .content-container").on("mouseenter", function () {
        if ($(document).width() >= 1200) {
            mktu_show(this);
            clearTimeout(timer_mktu);
            prev_item_mktu = this;
        }
    }).on("click", function () {
        if ($(document).width() < 1200 & prev_item_mktu !== this) {
            mktu_show(this);
            prev_item_mktu = this;
        }
    }).on("mouseleave", function () {
        if ($(document).width() >= 1200) timer_mktu = setTimeout(() => mktu_hide(this), 3000);
    });

    function mktu_show(show_element) {
        mktu_hide();
        if ($(document).width() >= 1200) $(show_element).addClass("active").children(".download-classes").fadeIn(400);
        else $(show_element).addClass("active").children(".download-classes").show(400);
    }

    function mktu_hide() {
        if ($(document).width() >= 1200) $(prev_item_mktu).removeClass("active").children(".download-classes").fadeOut(400);
        else $(prev_item_mktu).removeClass("active").children(".download-classes").hide(400);
    }

    function positionHandler() {
        var st = window.pageYOffset - $(".screen1_main_page .slick-container").offset().top;
        var b = $(window).height() / 205;
        var padHeight = $('.screen1_main_page .overlay').outerHeight() - 1;

        // console.log(padHeight);
        if (st / b > 0 && $(window).width() > 768) {
            $('.screen1_main_page .slick-container img').css('bottom', 0 - st / b);
        }
        else if ($(window).width() > 576) {
            $('.screen1_main_page .slick-container img').css('bottom', 0);
        } else {
            $('.screen1_main_page .slick-container .team').css('bottom', padHeight);
        }

    }

